import React, { useState } from 'react';
import './style.css';
import { getFilms } from './api';

const films = [
  {
    Title: 'Naruto: Shippuden',
    Year: '2007–2017',
    imdbID: 'tt0988824',
    Type: 'series',
    Poster:
      'https://m.media-amazon.com/images/M/MV5BZGFiMWFhNDAtMzUyZS00NmQ2LTljNDYtMmZjNTc5MDUxMzViXkEyXkFqcGdeQXVyNjAwNDUxODI@._V1_SX300.jpg',
  },
  {
    Title: 'Naruto',
    Year: '2002–2007',
    imdbID: 'tt0409591',
    Type: 'series',
    Poster:
      'https://m.media-amazon.com/images/M/MV5BZmQ5NGFiNWEtMmMyMC00MDdiLTg4YjktOGY5Yzc2MDUxMTE1XkEyXkFqcGdeQXVyNTA4NzY1MzY@._V1_SX300.jpg',
  },
  {
    Title: 'Boruto: Naruto Next Generations',
    Year: '2017–',
    imdbID: 'tt6342474',
    Type: 'series',
    Poster:
      'https://m.media-amazon.com/images/M/MV5BYjM0MDRkYzctMTNhMS00ODYwLTgwMWItZDYxNDlhOGY1YjRlXkEyXkFqcGdeQXVyMzExMzk5MTQ@._V1_SX300.jpg',
  },
  {
    Title: 'The Last: Naruto the Movie',
    Year: '2014',
    imdbID: 'tt3717532',
    Type: 'movie',
    Poster:
      'https://m.media-amazon.com/images/M/MV5BMjk1NzA4Njg4Ml5BMl5BanBnXkFtZTgwMDgxODQ5MzE@._V1_SX300.jpg',
  },
  {
    Title: 'Boruto: Naruto the Movie',
    Year: '2015',
    imdbID: 'tt4618398',
    Type: 'movie',
    Poster:
      'https://m.media-amazon.com/images/M/MV5BNDIwYjg5YzItZTJmMC00YjJhLWFiNjYtMDU5MmQxOTQxODM2XkEyXkFqcGdeQXVyMjc2Nzg5OTQ@._V1_SX300.jpg',
  },
  {
    Title: 'Road to Ninja - Naruto the Movie',
    Year: '2012',
    imdbID: 'tt2290828',
    Type: 'movie',
    Poster:
      'https://m.media-amazon.com/images/M/MV5BMTQ5MTcyNDYwMV5BMl5BanBnXkFtZTgwNzMzNzc0MjE@._V1_SX300.jpg',
  },
  {
    Title: 'Naruto the Movie: Ninja Clash in the Land of Snow',
    Year: '2004',
    imdbID: 'tt0476680',
    Type: 'movie',
    Poster:
      'https://m.media-amazon.com/images/M/MV5BYWFkMTJjODEtMjY2NC00OGRiLThkYjMtMzBjMzVhY2FlZTEyXkEyXkFqcGdeQXVyNjYwMjkwMjg@._V1_SX300.jpg',
  },
  {
    Title: 'Naruto Shippuden the Movie: Blood Prison',
    Year: '2011',
    imdbID: 'tt1999167',
    Type: 'movie',
    Poster:
      'https://m.media-amazon.com/images/M/MV5BMDgyZmRkYjUtMWExNS00NDQyLTliZTMtOTkwY2M3ZWU0ZjNmXkEyXkFqcGdeQXVyMjc2Nzg5OTQ@._V1_SX300.jpg',
  },
  {
    Title: 'Naruto Shippuden: The Movie - Bonds',
    Year: '2008',
    imdbID: 'tt1160524',
    Type: 'movie',
    Poster:
      'https://m.media-amazon.com/images/M/MV5BNTE2ODAyNTkxNl5BMl5BanBnXkFtZTgwNTAzMjA2MDE@._V1_SX300.jpg',
  },
  {
    Title: 'Naruto the Movie 2: Legend of the Stone of Gelel',
    Year: '2005',
    imdbID: 'tt0791188',
    Type: 'movie',
    Poster:
      'https://m.media-amazon.com/images/M/MV5BMDE3NjY3Y2MtODE4YS00YzFiLThhMTMtY2Q1NTZkODE4M2NlXkEyXkFqcGdeQXVyNjYwMjkwMjg@._V1_SX300.jpg',
  },
];

export default function App() {
  const [filmName, setFilmName] = useState('');

  const [filmsData, setfilmsData] = useState(films);

  const handleFilmNameChange = (e) => {
    setFilmName(e.target.value);
  };

  const handleClickAnime = async (e) => {
    const r = await getFilms(filmName);

    setfilmsData(r.Search);
  };

  return (
    <div style={{ textAlign: 'center', paddingTop: '50px' }}>
      <h1>Liste film Anime</h1>
      <div>
        <input
          type="text"
          placeholder="Nom du film..."
          value={filmName}
          onChange={handleFilmNameChange}
          style={{ borderRadius: '20px', margin: '10px' }}
        />
        <button onClick={handleClickAnime}> search </button>
      </div>
      <div
        style={{
          display: 'flex',
          flexWrap: 'wrap',
          margin: '5px',
          padding: '10px',
          justifyContent: 'center',
        }}
      >
        {filmsData.map((film) => (
          <div
            style={{
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              maxWidth: '180px',
              margin: '10px',
            }}
          >
            <div
              style={{
                width: '200px',
                height: '40px',
                fontFamily: 'Verdana',
              }}
            >
              {film.Title}
            </div>
            <div>
              <a
                href={'https://www.imdb.com/title/' + film.imdbID}
                style={{
                  position: 'relative',
                  width: '200px',
                  height: '300px',
                  top: '0px',
                  left: '0px',
                }}
              >
                <img
                  src={film.Poster}
                  style={{ width: '180px', height: '250px' }}
                />
                <button
                  style={{
                    position: 'absolute',
                    borderRadius: '10px',
                    width: '60px',
                    height: '30px',
                    bottom: '0px',
                    left: '0px',
                  }}
                >
                  favoris
                </button>
              </a>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
